import React from "react"
import Img from "./Img"
import { useState } from "react"


export default function Card(props) {

    const [imgArray, setImgArray] = useState([])

    function renderGalleryItem(){
        fetch("https://api.unsplash.com/collections/907185/photos/?client_id=GUOJSuCC3h67wLW1KgIFaXBbR43XKLZWKw4hSKpAkds")
         .then(response => response.json())
           .then(data => {
              setImgArray(data)
              console.log(data)
           })
       }

       renderGalleryItem()

    const imgs = imgArray.map(item => { 
        return (
        <Img
        key={item.id}
        alt={item.alt_description}
        url={item.urls.regular}

        />)

    })

    return(
        <div className="card-box box1">
        <div className="card-img">
           {imgs}
        </div>
        <div className="card-text"> {props.about} </div>
    </div>
    )
}
